<!doctype html>
<html>
<head>
    <style>
        body{
            position:absolute;
            overflow: hidden;
            margin:0;
            padding:0;
        }
        img.splash-image{
            position: absolute;
            z-index: 99;
            left: 0;
            top: 0;
        }
        div#bar {
            position: relative;
            display: inline-flex;
            top: 211px;
            z-index: 1000;
            width: 500px;
            height: 3px;
        }

        div#bar span {
            height: 100%;
            display: block;
            background: #ddd1ff;
            animation: pulse 1s infinite, grow 1s ease-out;
        }

        @keyframes pulse {
            0% {  box-shadow: #ddd1ff 0px 0px 8px;  }
            50% {  box-shadow: #ddd1ff 0px 0px 4px; }
            100% {  box-shadow: #ddd1ff 0px 0px 8px;}
        }

        @keyframes grow {
            0% {
                width: 0;
            }
        }
    </style>
</head>
